import React from 'react';
import logo from './logo.svg';
import './App.css';
import Employees from './employee.js';
import MyForm from './MyForm.js';
function App() {
  return (
  <div className="bg">
    <div className="App">
      <header className="App-header">
       <font color="red"><h1>Employee List</h1></font>
        <Employees />
        <MyForm />
        <h2>Add New Employee</h2>

      </header>
    </div>
    </div>
  );
}

export default App;
